import Dashboard from "layouts/PO/dashboard";
import StudentEntry from "layouts/PO/studentEntry";
import Profile from "layouts/PO/profile";

// @mui icons
import Icon from "@mui/material/Icon";
import CompanyData from "layouts/PO/companyEntry";
import AlumniData from "layouts/PO/AlumniEntry";
import StaffEntry from "layouts/PO/StaffEntry";
import AlumniList from 'layouts/STUDENT/AlumniList';

const routes = [
  {
    type: "PO",
    name: "Dashboard",
    key: "dashboard",
    icon: <Icon fontSize="small">dashboard</Icon>,
    route: "/dashboard",
    component: <Dashboard />,
  },
  {
    type: "PO",
    name: "Staff Info",
    key: "staff Infor",
    icon: <Icon fontSize="small">dashboard</Icon>,
    route: "/StaffEntry",
    component: <StaffEntry />,
  },
  {
    type: "PO",
    name: "Student Entry",
    key: "studentDetails",
    icon: <Icon fontSize="small">table_view</Icon>,
    route: "/studentEntry",
    component: <StudentEntry />,
  },
  {
    type: "PO",
    name: "Alumni Entry",
    key: "AlumniInfo",
    icon: <Icon fontSize="small">table_view</Icon>,
    route: "/AlumniEntry",
    component: <AlumniData />,
  },
  {
    type: "PO",
    name: "Company Entry",
    key: "companyEntry",
    icon: <Icon fontSize="small">receipt_long</Icon>,
    route: "/companyEntry",
    component: <CompanyData />,
  },
  {
    type: "All",
    name: "Profile",
    key: "profile",
    icon: <Icon fontSize="small">person</Icon>,
    route: "/profile",
    component: <Profile />,
  },
  {
    type: "All",
    name: "AlumniList",
    key: "alumniList",
    icon: <Icon fontSize="small">person</Icon>,
    route: "/alumniList",
    component: <AlumniList />,
  },
  {
    type: "All",
    name: "AlumniList",
    key: "stafList",
    icon: <Icon fontSize="small">person</Icon>,
    route: "/staffList",
    component: <StaffList />,
  },

  // {
  //   type: "All",
  //   name: "Change Password",
  //   key: "sign-in",
  //   icon: <Icon fontSize="small">login</Icon>,
  //   route: "/authentication/sign-in",
  //   component: <SignIn />,
  // },
];

export default routes;
